import React from 'react';
import Link from 'next/link';

class App extends React.Component {

    render() {
        return (
            <React.Fragment>

                <h1>Hello World!</h1>

                <li>
                    <Link href="/pageOne" title="page One">
                        <a>Page One</a>
                    </Link>
                </li>

                <li>
                    <Link href="/pageTwo" title="page Two">
                        <a>Page Two</a>
                    </Link>
                </li>

                <li>
                    <Link href="/pageThree" title="page Three">
                        <a>Page Three</a>
                    </Link>
                </li>

            </React.Fragment>

        )
    }

}

export default App;
